subSubSection.paragraph:
Diagnosis . The male can be distinguished from other Australian species by the very long cymbium, which is up to six times as long as the diameter of the bulb and also by the presence on the conductor tip of a flange which sweeps around it about 180° ( Figs 26a–c,e,f , 28a–d ). The female can be distinguished by the lateral profile of the epigyne in which the scape protrudes at almost 90° (
Fig. 27g
).

