subSubSection.paragraph:
Trichobothria on first tarsus, 6, increasing in length distally. Spination . Leg I: femur d1,3,3,3,3; tibia v1,2 p1; metatarsus d2 v2,2,2 p1,1. Leg II: femur d1,3,3,3,3; tibia v1,1,2 p1; metatarsus d1,1,2 v2,2,2 p1,1. Leg III: femur d2,3,3,1,3,3; tibia d1,1 v1,2,2 p1 r1,1; metatarsus d1,2,2,2, v2,2,2. Leg IV: femur d1,1,1,1,1,1,3; tibia v2,2,2p1 r1,1; metatarsus d1,1,1,1,2 v1,1,1,1,1,2. Palp: femur d1,1,1,1,3 p1; patella d1; tibia d1 p1. Epigyne ( Fig. 27f ). Width almost twice length. Long hairs directed posteriorly from anterior and sides. Scape protruding ventrally at almost 90° (
Fig. 27g
). Lateral extension of scape extending to lateral margins of genital atria. Genital openings situated in posterior half of epigyne. Spermathecae large. Insemination ducts weakly convoluted (one full bend) with posteriorly directed diverticula where insemination ducts join spermathecae ( Fig. 27e,g ).

The only observed discrete difference in morphology was the presence of a bifurcate tip to the retrolateral apophysis in some specimens from Glen Forrest (
Fig. 19a
). All other differences in morphology, particularly with respect to the conductor tip (
Fig. 28a–d
) and the height and twisting of the retrolateral apophysis (
Fig. 29a–d
) were due to individual variation or were continuous geographically. A distinct pit with an inner structure is present beneath the tip of the retrolateral apophysis in specimens from 
Stirling
Ranges (
Fig. 29b
) but is absent in specimens from Perth, Gelorup and Albany (
Fig. 29a,c
). A less clearly defined pit structure is present in specimens from Glen Forrest. Similarly, a protrusion or crest on the outer final bend of the retrolateral apophysis (
Fig. 29d
) is present on specimens from Albany and to a lesser extent from Gelorup (
Fig. 29c
) but appears to be absent from specimens from other regions.
